import React from 'react';

import Container from '@material-ui/core/Container';
import Box from '@material-ui/core/Box';
import Typography from '@material-ui/core/Typography';
import Grid from '@material-ui/core/Grid';
import TextField from '@material-ui/core/TextField';

export default function Component(props) {

  return (
    <section>
      <Container maxWidth="xs">
        <Box pt={8} pb={10}>
          <Box mb={3} textAlign="center">
            <Typography variant="h5" component="h2">Revenue Streams</Typography>
          </Box>
          <Box>
            <form noValidate>
              <Grid container spacing={2}>
                <Grid item xs={12}>
                  <TextField variant="outlined" required fullWidth name="salesRevenue" id="salesRevenue" label="Sales Revenue"/>
                </Grid>
                <Grid item xs={12}>
                  <TextField variant="outlined" fullWidth name="intangibleRevenue" id="intangibleRevenue" label="Intangible Revenue"/>
                </Grid>
                <Grid item xs={12}>
                  <TextField variant="outlined" fullWidth name="potentialRevenue" id="potentialRevenue" label="Potential Revenue"/>
                </Grid>
              </Grid>
            </form>
          </Box>
        </Box>
      </Container>
    </section>
  );
}
